import React, { useState, useEffect } from 'react';

export default function Created() {
  const [studentData, setStudentData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8081/Created');
        const data = await response.json();
        if (Array.isArray(data)) {
          setStudentData(data);
        } else {
          setStudentData([]);
        }
      } catch (error) {
        console.error('Error:', error);
        setStudentData([]); 
      }
    };

    fetchData();
  }, []);
// Python model run fuction
const [show,setShow]=useState(false);
function predictbtn(){
  setShow(true)
  
}
let prone='';
if((studentData[0].blurry_vision && !studentData[0].excessive_thirst) || (!studentData[0].blurry_vision && !studentData[0].excessive_thirst && studentData[0].fatigue && !studentData[0].excessive_urination)){
  prone=false;
}
else{
  prone=true;
}


console.log(studentData[0].blurry_vision)
  return (
    <>

      
      <div className='text-center center2'>
      <h2 className='colorw'>Patient's Data Added</h2>
  <table className="table2">
    <thead>
      <tr>
        <th>ID</th>
        <th>Excessive Thirst</th>
        <th>Excessive Urination</th>
        <th>Blurry Vision</th>
        <th>Fatigue</th>

       
      </tr>
    </thead>
    <tbody className='tbody'>
      {studentData.map((student, index) => (
        <tr key={index}>
          <td>{student.id}</td>
          <td>{student.excessive_thirst}</td>
          <td>{student.excessive_urination}</td>
          <td>{student.blurry_vision}</td>
          <td>{student.fatigue}</td>
          
        </tr>
      ))}
    </tbody>
  </table>
  <div>
  <button className='btn btn-success colorb' onClick={predictbtn}>Predict</button>
  </div>
  {prone?  <div className='colorw'>Prone to diabetes Consult Your Doctor</div>
:""}
</div>

    </>
  );
}
